import React from 'react'

function CollectionList(props) {
  console.log(props)
  return (
    <div>
      <div className='collectionListMainContainer'>
        <p>{props.warehouse.name}</p>
        <p>City : {props.warehouse.city}</p>
      </div>
    </div>
  )
}

export default CollectionList
